import Link from "next/link";

const Landing = () => (
  <div className="landing">
    <section id="intro">
      <h1>WOO YOUNG CHOI</h1>
      <p>
        <span>Designer</span> & <span>Front-end Developer</span> based in NY.
      </p>
    </section>
    <style jsx>
      {`
        .landing {
          align-items: center;
          display: flex;
          flex-direction: column;
          font-family: Futura;
          justify-content: center;
          min-height: 100vh;
          text-align: center;
        }

        h1 {
          font-family: Futura;
          font-size: 65px;
          font-weight: 600;
          box-shadow: 5px 5px 10px #999;
        }

        p {
          font-family: Montserrat;
          font-size: 16px;
          font-weight: 100;
        }

        span {
          font-size: 19px;
          font-weight: 900;
        }
      `}
    </style>
  </div>
);

export default Landing;
